import{a as y}from"./chunk-BVWRDFU3.js";import"./chunk-DFFVOSJF.js";import{Fb as o,Ja as r,Ua as c,lb as z,mb as i,nb as a,ob as n}from"./chunk-BP7CLSB6.js";var s=class t{faqItems=[{title:"Manicure klasyczny",answer:"Obejmuje z\u0142uszczenie nask\xF3rka, opi\u0142owanie i wypolerowanie p\u0142ytki paznokciowej, kt\xF3rej nadajemy po\u017C\u0105dany kszta\u0142t. P\u0142ytk\u0119 paznokciow\u0105 malujemy dowolnie wybranym kolorem lakieru zabezpieczaj\u0105c go bazami tak, aby paznokcie d\u0142ugo cieszy\u0142y nas nienagannym wygl\u0105dem. Po zako\u0144czonym zabiegu nawil\u017Camy sk\xF3rki profesjonalnym olejkiem, aby zapobiec nadmiernemu wysuszaniu a na d\u0142onie aplikujemy krem od\u017Cywczy."},{title:"Manicure Shellac",answer:"Shellac to po\u0142\u0105czenie najlepszych cech klasycznych lakier\xF3w do paznokci \u2013 czyli \u0142atwo\u015Bci w nak\u0142adaniu i \u015Bci\u0105ganiu, braku konieczno\u015Bci pi\u0142owania p\u0142ytki paznokciowej, a tak\u017Ce szybko\u015Bci wykonania manicure oraz \u017Celu \u2013 czyli wytrzyma\u0142o\u015Bci i nie\u015Bcieralno\u015Bci. Dzi\u0119ki temu ponad 14 dni mo\u017Cna cieszy\u0107 si\u0119 idealnie trwa\u0142ym kolorem bez wzgl\u0119du na to, jak intensywnie u\u017Cywamy naszych paznokci.<br/><br/>Wykonanie manicure hybrydowego Shellac jest podobne do wykonania klasycznego manicure. Shellac to produkt hipoalergiczny \u2013 nie powoduje \u017Cadnej szkody dla naturalnej p\u0142ytki paznokcia."},{title:"Manicure hybrydowy",answer:"Manicure hybrydowy likwiduje problem nieestetycznego odpryskiwania lakieru na paznokciach d\u0142oni i st\xF3p. Zapewniamy g\u0142adki i nieskazitelny efekt utrzymuj\u0105c si\u0119 przez dwa tygodnie. Lakiery do paznokci s\u0105 utwardzane \u015Bwiat\u0142em UV. Oferujemy bardzo szerok\u0105 gam\u0119 kolorystyczn\u0105 (ok. 50 kolor\xF3w)."},{title:"Manicure japo\u0144ski od\u017Cywczy - P shaine",answer:"Metoda zalecana na kruche paznokcie, \u0142amliwe i rozdwajaj\u0105ce si\u0119. Zabieg wzmacnia naturalne paznokcie nadaj\u0105c im po\u0142ysk r\xF3\u017Cowej per\u0142y. Ten unikatowy manicure nadaje paznokciom blask i zasila je w witaminy, keratyn\u0119, py\u0142ek pszczeli oraz krzemionk\u0119 z morza japo\u0144skiego. Nie jest wskazane malowanie paznokci przez 4-5 dni."},{title:"Klasyczne malowanie i zdobienie paznokci",answer:"Obejmuje klasyczne malowanie i zdobienie dowoln\u0105 technik\u0105. Naturalne paznokcie zabezpieczamy baz\u0105 od\u017Cywcz\u0105 a na lakier nak\u0142adamy TOP \u2013 aby kolor utrzymywa\u0142 si\u0119 stosunkowo d\u0142ugo. Olejek i krem piel\u0119gnacyjny w standardzie. Oferujemy bardzo szerok\u0105 gam\u0119 kolorystyczn\u0105 profesjonalnych lakier\xF3w (ok. 100 kolor\xF3w) \u2013 najnowszych kolekcji."},{title:"K\u0105piel parafinowa - zabieg piel\u0119gnacyjny",answer:"Wyg\u0142adza i regeneruje such\u0105 i szorstk\u0105 sk\xF3r\u0119, uelastycznia j\u0105. Wspomaga wch\u0142anianie innych preparat\xF3w piel\u0119gnacyjnych. Poprawia kr\u0105\u017Cenie, rozlu\u017Ania mi\u0119\u015Bnie, koi bol\u0105ce stawy. Zabieg silnie wzmacniaj\u0105cy i nawil\u017Caj\u0105cy dla naszych d\u0142oni i paznokci."},{title:"Odnawiaj\u0105ca piel\u0119gnacja d\u0142oni",answer:"Zalecamy w pierwszym etapie zabiegu peeling g\u0142\u0119boko oczyszczaj\u0105cy, nast\u0119pnie masa\u017C na bazie musu ciep\u0142ej \u015Bwiecy i kompres g\u0142\u0119boko regeneruj\u0105cy. Magiczne z\u0142oto, wyci\u0105g z rokietnika i magnolii, ponad 100 r\xF3\u017Cnych bioaktywnych ekstrakt\xF3w m\u0142odo\u015Bci idealnie nawil\u017Ca, przyspiesza regeneracj\u0119, roz\u015Bwietla i liftinguje sk\xF3r\u0119, pozostawiaj\u0105c nasze d\u0142onie j\u0119drne i g\u0142adkie na d\u0142ugi czas."},{title:"Stylizacja i rekonstrukcja paznokci",answer:"Wykonujemy przed\u0142u\u017Canie paznokci metod\u0105 akrylow\u0105 i \u017Celow\u0105 w spos\xF3b stosunkowo mniej inwazyjny i szkodliwy dla p\u0142ytki paznokciowej. Wykonane w ten spos\xF3b paznokcie mog\u0105 wygl\u0105da\u0107 bardzo naturalnie a przy okazji s\u0105 du\u017Co twardsze i bardziej wytrzyma\u0142e od naturalnych. Jest to \u015Bwietne rozwi\u0105zanie dla os\xF3b, kt\xF3rych biologiczne paznokcie s\u0105 s\u0142abe, czy te\u017C s\u0105 stosunkowo (poprzez charakter pracy) cz\u0119sto nara\u017Cone na uszkodzenia. Tak\u017Ce dla os\xF3b, kt\xF3re kochaj\u0105 nienaganny wygl\u0105d swoich d\u0142oni i paznokci na co dzie\u0144. Preferujemy bardzo naturaln\u0105 stylizacj\u0119 i rekonstrukcj\u0119.<br/><br/>\u2013 stylizacja i rekonstrukcja metod\u0105 \u017Celow\u0105<br/>\u2013 stylizacja i rekonstrukcja metod\u0105 akrylow\u0105<br/>\u2013 stylizacja natural tips<br/>\u2013 stylizacja natural french<br/>\u2013 uzupe\u0142nienie metod\u0105 \u017Cel/akryl<br/>\u2013 wtopienia i zdobienia"}];static \u0275fac=function(e){return new(e||t)};static \u0275cmp=c({type:t,selectors:[["app-nail-styling"]],decls:11,vars:1,consts:[[1,"sale-page"],[1,"sale-header"],[1,"divider"],[1,"sale-content"],[1,"sale-text"],["src","assets/oferta-podstrony/paznokcie.jpg","alt","Stylizacja paznokci",1,"sale-img"],[1,"w-100",3,"items"]],template:function(e,k){e&1&&(i(0,"section",0)(1,"header",1)(2,"h1"),o(3,"Stylizacja paznokci"),a(),n(4,"div",2),a(),i(5,"div",3)(6,"div",4)(7,"p"),o(8," Wypiel\u0119gnowane oraz zadbane d\u0142onie i paznokcie s\u0105 nasz\u0105 najlepsz\u0105 wizyt\xF3wk\u0105. Pragn\u0105c wyj\u015B\u0107 na przeciw Twoim oczekiwaniom stworzyli\u015Bmy szerok\u0105 ofert\u0119 zabiegow\u0105 aby w pe\u0142ni usatysfakcjonowa\u0107 nawet najbardziej wymagaj\u0105ce d\u0142onie na \u201Ewyci\u0105gni\u0119cie r\u0119ki\u201D. Przy odrobinie konsekwentnej piel\u0119gnacji stan\u0105 si\u0119 ozdob\u0105 i wizyt\xF3wk\u0105 naszego wizerunku. "),a()()(),n(9,"img",5)(10,"app-faq",6),a()),e&2&&(r(10),z("items",k.faqItems))},dependencies:[y],encapsulation:2})};export{s as NailStyling};
